// src/components/Contact.js
import React from 'react';
import styled from 'styled-components';

const Contact = () => {
  return (
    <ContactContainer>
      <h2>Contact</h2>
      <p>Email: myemail@example.com</p>
    </ContactContainer>
  );
};

const ContactContainer = styled.div`
  padding: 20px;
  text-align: center;
  color: #61dafb;
`;

export default Contact;
